export const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row className="align-items-center">
          <Col size={12} sm={6}>
            {/* <img src={logo} alt="Logo" /> */}
          </Col>
          <Col size={12} sm={6} className="text-center text-sm-end">
            <div className="social-icon">
              <a href="https://github.com/oscarmedina234"><img src={navIcon1} alt="Icon" /></a>
              <a href="https://www.linkedin.com/in/oscar-medina-82b771265/"><img src={navIcon2} alt="Icon" /></a>
              {/* <a href="#"><img src={navIcon3} alt="Icon" /></a> */}
            </div>
          </Col>
        </Row>
      </Container>
    </footer>
  )
}
